import React, {Component} from 'react';
import MiniCount from "./Mini_count";

class Counter extends Component {
    render() {
        return (
            <div className="container" data-aos="zoom-out">
                <div id="counter" className="row text-center">
                    <MiniCount counticon="fas fa-laptop-code" numbercount="189" counttitle="Dự Án"/>
                    <MiniCount counticon="fas fa-user-tie" numbercount="2500" counttitle="Khách Hàng"/>
                    <MiniCount counticon="fas fa-briefcase" numbercount="30" counttitle="Đối Tác"/>
                    <MiniCount counticon="fas fa-users" numbercount="68" counttitle="Nhân Viên"/>
                </div>
            </div>
        );
    }
}

export default Counter;
